import React, {Component} from 'react';

import { BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom';
import { TransitionGroup, CSSTransition } from 'react-transition-group';

import AboutNavBar from './components/AboutNavBar';

import Member from './routes/Member';
import Research from './routes/Research';
import Publications from './routes/Publications';
import Contact from './routes/Contact';

import './../../css/Selab.scss';

const pageTrans = 'trans-s'
const classNames = {
  appear: `${pageTrans} appear`,
  appearActive: `${pageTrans} appear active`,
  appearDone: `${pageTrans} appear done`,
  enter: `${pageTrans} enter`,
  enterActive: `${pageTrans} enter active`,
  enterDone: `${pageTrans} enter done`,
  exit: `${pageTrans} exit`,
  exitActive: `${pageTrans} exit active`,
  exitDone: `${pageTrans} exit done`
}


class Selab extends Component {
  constructor(props) {
    super(props);

    this.state = {
      location: [MemberTest, ResearchTest, PublicationsTest, ContactTest]
    }
  }

  componentDidMount() {
    console.log(this.state.location);
  }

  //메인 화면
  render() {
    function loremIpsum() {
      return (
        <div className="AboutLabTest">
          <div className="LabTestCurrent">
            {/*건들지마요*/}
          </div>
          <div id="MemberTest">

          </div>

        </div>
      );
    }

    return(
      <Router>
        <div className="Contents-page2">
          <AboutNavBar />
          <div className="Lab-contents">
          <Route
              render={({ location }) => (
              <TransitionGroup>
                <CSSTransition
                  key={location.pathname}
                  timeout={700}
                  classNames={classNames}
                  >
                </CSSTransition>
              </TransitionGroup>
              )} />
          </div>
        </div>
      </Router>
    );
  }
}

export default Selab;
